import React, { Component } from 'react'

export class Menu extends Component {
    render() {
        return (
            this.props.items.map((item, index) => (
                <li key={index} className="list">
                        <h1 key={item}>{item.text}</h1>
                </li>
                )
            )
        )
    }
}

export default Menu;
